import React, { Component } from "react";
import './form.css';
import styled from "styled-components";

const Formdata = styled.div`
  background-color: aquamarine;
  height: auto;
  width: 400px;
  margin: auto;
  padding: 5px;
`;

const indianStates = [
  "Andhra Pradesh", "Arunachal Pradesh", "Assam", "Bihar", "Chhattisgarh",
  "Goa", "Gujarat", "Haryana", "Himachal Pradesh", "Jharkhand",
  "Karnataka", "Kerala", "Madhya Pradesh", "Maharashtra", "Manipur",
  "Meghalaya", "Mizoram", "Nagaland", "Odisha", "Punjab",
  "Rajasthan", "Sikkim", "Tamil Nadu", "Telangana", "Tripura",
  "Uttar Pradesh", "Uttarakhand", "West Bengal", "Andaman and Nicobar Islands",
  "Chandigarh", "Dadra and Nagar Haveli and Daman and Diu", "Delhi",
  "Jammu and Kashmir", "Ladakh", "Lakshadweep", "Puducherry"
];

const gender = ['Male', 'Female', 'Other'];

class Form extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      lastname: '',
      fathername: '',
      mothername: '',
      email: '',
      birthdate: '',
      state: '',
      gender: '',
      number: ''
    };
  }

  onchengeform = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };

  onsubmitform = (e) => {
    e.preventDefault();
    console.log('Form submitted:', this.state);
  };

  render() {
    const buttons = {
      width: "40%",
      marginLeft: "10px"
    };

    return (
      <Formdata>
        <form onSubmit={this.onsubmitform}>
          <label htmlFor="name">First Name</label>
          <input type="text" name="name" id="name" placeholder="Enter your name" onChange={this.onchengeform} />

          <label htmlFor="lastname">Last Name</label>
          <input type="text" name="lastname" id="lastname" placeholder="Enter last name" onChange={this.onchengeform} />

          <label htmlFor="fathername">Father Name</label>
          <input type="text" name="fathername" id="fathername" placeholder="Enter father name" onChange={this.onchengeform} />

          <label htmlFor="mothername">Mother Name</label>
          <input type="text" name="mothername" id="mothername" placeholder="Enter mother name" onChange={this.onchengeform} />

          <label htmlFor="birthdate">Date of Birth</label>
          <input type="date" name="birthdate" id="birthdate" onChange={this.onchengeform} />

          <label htmlFor="email">Email</label>
          <input type="email" name="email" id="email" onChange={this.onchengeform} />

          <label htmlFor="state">State</label>
          <select name="state" style={{ width: "90%" }} onChange={this.onchengeform}>
            <option value="">Select state</option>
            {indianStates.map((state, index) => (
              <option key={index} value={state}>{state}</option>
            ))}
          </select>

          <label htmlFor="gender">Gender</label>
          <select name="gender" style={{ width: "90%" }} onChange={this.onchengeform}>
            <option value="">Select gender</option>
            {gender.map((g, index) => (
              <option key={index} value={g}>{g}</option>
            ))}
          </select>

          <label htmlFor="number">Contact Number</label>
          <input type="number" name="number" id="number" onChange={this.onchengeform} />

          <button type="reset" style={buttons}>Reset</button>
          <button type="submit" style={buttons}>Submit</button>
        </form>
      </Formdata>
    );
  }
}

export default Form;
